-- A bit complicated but there isn't anything similar to
-- WITH SELECT FROM(VALUES()) in MySQL AFAIK.

CREATE TEMPORARY TABLE `products_temp`(
	temp_name TEXT,
	temp_man VarChar(50),
	temp_cat VarChar(50),
	temp_price FLOAT,
	temp_quan INT,
	temp_img TEXT
);


SELECT temp_name, manufacturer_id, category_id, temp_price, temp_quan,temp_img
FROM products_temp
JOIN manufacturers
	ON manufacturers.manufacturer_name = products_temp.temp_man
JOIN categories
	ON categories.category_name = products_temp.temp_cat;
	
	